INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-173, -173, 'Boško', 'Kulušić', 'bk@gmail.com', 'Follow the life of Boško Kulušić, an art historian turned world traveler. From the Louvre to the ancient temples of Kyoto, Boško''s passion for culture and history shapes her unique journey.', 'Immerse in cultures, connect through differences.');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-3, -3, 'Veljko', 'Nikolić', 'nikolicveljko01@gmail.com', 'Meet Veljko Nikolić, a free spirit who''s traded stability for a life on the road. From the deserts of Morocco to the jungles of Southeast Asia, Veljko''s journey is a tapestry of cultures and landscapes', 'Stay strong.');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-183, -183, 'Velimir', 'Milinković', 'veco@gmail.com', NULL, NULL);
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-182, -182, 'Marko', 'Nikolić', 'starijiblizanac@gmail.com', 'Follow Marko Nikolić on her spiritual quest, seeking enlightenment in sacred places around the world. Her biography is a soul-stirring narrative of self-discovery and mindful travel.', 'Get lost in city lights');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-181, -181, 'Nina', 'Kuzminac', 'nina@gmail.com', 'Enter the glamorous world of Nina Kuzminac, a high-flying businesswoman who knows how to travel in style. From luxury resorts to private yachts, Nina''s life is a lavish odyssey of opulence.', 'Chase sunsets and let the waves be your melody');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-180, -180, 'Uroš', 'Nikolovski', 'uki@gmail.com', 'Strap in with Max Thrillseeker, an adrenaline junkie who chases adventure in the world''s most extreme environments. From skydiving over the Swiss Alps to surfing in Hawaii, Max''s biography is an exhilarating ride', 'Nurture your soul, rejuvenate your spirit, and find serenity on the road');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-179, -179, 'Jelena', 'Kovač', 'jelena@gmail.com', NULL, NULL);
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-168, -168, 'Dragoslav', 'Maslać', 'gagi@gmail.com', 'Meet Dragoslav Maslać, a free spirit who''s traded stability for a life on the road. From the deserts of Morocco to the jungles of Southeast Asia, Dragoslav''s journey is a tapestry of cultures and landscapes', NULL);
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-184, -184, 'Vukašin', 'Dokmanović', 'dokma@gmail.com', 'Join Vukašin Dokmanović as he embraces the slow travel movement, savoring every moment and connection on his journey. His biography is a reflection of the beauty found in taking the scenic route through life.', 'Nurture your soul, rejuvenate your spirit, and find serenity on the road.');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-178, -178, 'Ivan', 'Partalo', 'kurbanov@gmail.com', 'Dive into the life of Ivan Partalo, an archaeologist who travels through time to uncover the mysteries of ancient civilizations. His journey unfolds as a thrilling historical quest across continents', 'Nurture your soul, rejuvenate your spirit, and find serenity on the road');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-177, -177, 'Ivana', 'Kovačević', 'ivana@gmail.com', 'Join Ivana Kovačević, an environmentalist backpacker, on her quest to explore the world while minimizing her ecological footprint. Her story is one of sustainable travel, conservation efforts, and a deep connection with nature.', 'Capture moments, tell tales: a visual journey of a thousand memories');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-176, -176, 'Anja', 'Dučić', 'anja@gmail.com', 'Dive into the life of Anja Dučić, an archaeologist who travels through time to uncover the mysteries of ancient civilizations. Her journey unfolds as a thrilling historical quest across continents.', 'Wander through the past, where every step tells a story');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-174, -174, 'Marko', 'Čekerinac', 'ceki@gmail.com', 'Marko Cekerinac, an environmentalist backpacker, on his quest to explore the world while minimizing his ecological footprint.', 'Explore the world''s wonders, one breathtaking view at a time');
INSERT INTO stakeholders."People" ("Id", "UserId", "Name", "Surname", "Email", "Bio", "Motto") VALUES (-175, -175, 'Marko', 'Krstić', 'gadni@gmail.com', 'Indulge in the culinary escapades of Marko Krstić, a globetrotting chef in search of the world''s most tantalizing flavors. His biography is a savory tale of gastronomic delights and international culinary adventures.', 'Savor the flavors, one dish at a time');
